import React from "react";

const Recipe = ({ title, calories, image, ingredients }) => {
  return (
    <div>
      <h2>{title}</h2>
      <ol>{ingredients.map(ingredient => (ingredient.text))}</ol>
      <p>{calories}</p>
      <img src={image} alt=""></img>
    </div>
  );
};

export default Recipe;
